import math

def solve(a, b):
    if b == a + 1:
        return -1
    if a % 2:
        if b == a + 2:
            return -1
        if math.gcd(a, a + 3) > 1:
            ans = str(a) + ' ' + str(a + 3)
            return ans
        return str(a + 1) + ' ' + str(a + 3)
    else:
        return str(a) + ' ' + str(a + 2)
for _ in range(int(input())):
    (a, b) = map(int, input().split())
    print(solve(a, b))

